        return str(evaluate_expression(left) - evaluate_expression(right))
    elif '*' in expression:
        left, op, right = expression.split('*')
        return str(evaluate_expression(left) * evaluate_expression(right))
    elif '/' in expression:
        left, op, right = expression.split('/')
        return str(evaluate_expression(left) / evaluate_expression(right))
    else:
        return int(expression)

